import React from 'react'
import Dashboard from './Dashboard';
import Login from './Login';

export default function DefaultLayout() {

  const isAuthenticated = () => {
    return !!localStorage.getItem("token");
  };
  return (
    isAuthenticated()
    ? <Dashboard />
    : <Login />
  )
}
